UNCHAIN UKRAINE HAS ALREADY COLLECTED $3,031,547 FOR HUMANITARIAN AID TO UKRAINE

A total of $471,378 was distributed, of which more than $167,547 was distributed on March 4.

A total of 255 applications were funded, including 81 applications yesterday. The main part of the recipients are still directed to activists and volunteers. For almost two weeks they are in a non-stop marathon of helping those who in need. 

Among volunteers we’ve helped are:
💙 Daria from Cherkasy, who helps with the purchase of non-combat equipment for volunteers who protect the city;
💛 Alexander from Kyiv, who distributes food to needy city residents;
💙 Maxim from Chernivtsi, who buys food and hygiene products for the disabled, pensioners and refugees;
💛 Ivan from Lviv, who buys medicines for the refugee center at the Lviv Theater named after Les Kurbas.
And hundreds of other heroes of ‘humanitarian frontline’, who we will also introduce soon.

