UNCHAIN UKRAINE HAS ALREADY RAISED $3,540,530 FOR HUMANITARIAN AID TO UKRAINE

A total of $593,073 was distributed, of which more than $121,695 was distributed on March 5.

A total of 255 applications were funded, including 81 applications yesterday. One more time we’d like to tell you in brief about the volunteers who we help so they can continue helping to all those in need. 

Among them:
💙 Ihor from the village Velyki Kalenychi, Khmelnytsky region, who purchases and transfers medicines to the central hospital of Polonska and Poninkivska TG;
💛 Yana from Kharkiv, who buys and delivers medicines and food to maternity hospitals;
💙 Andriy from Chernivtsi, who buys humanitarian aid (medicines, food, hygiene products and clothes) in Chernivtsi region and sends them by bus to Kyiv;
💛 Khrystyna from Ivano-Frankivsk, who buys the necessary goods for the affected civilians and Territorial Defence fighters and then organises logistics to hot spots.
