Unchain Fund especially appreciates the support of: 
🙏 Artem Kovbel (auditor, co-founder of Crowe Erfolg);
🙏 Oleg Kurchenko (founder of Binaryx, co-founder of OXO Capital and Unchain Fund);
🙏Gitcoin (will support Unchain in the next round of funding, also aimed at supporting Ukraine in times of crisis);
🙏Brave Software (used own medias and products to spread the word about Unchain Fund to 50+ million audience).  

We will come back to you with some new photo and video confirmations of our work.

Glory to Ukraine! 🇺🇦

